let initialState ={
    friend: [
        {id: 1, name: 'Marina'},
        {id: 2, name: 'Sveta'},
        {id: 3, name: 'Pasha'}
    ],

    navigation: [
        {id: '/profile', name: 'Profile', active: 'classes.active'},
        {id: '/dialog', name: 'Dialog', active: 'classes.active'},
        {id: '/users', name: 'Users', active: 'classes.active'},
        {id: '/music', name: 'Music', active: 'classes.active'},
        {id: '/setting', name: 'Setting', active: 'classes.active'},
    ]
};
const SidebarReducer = (state = initialState, action)=>
{
    return state;
}
export default SidebarReducer;
